import React from 'react'

export const WeatherHeadline = () => {
  return (
    <div className='.HeadLine'>
        <div className='.boxImg'>
            <img/>
        </div>
        <p className='city'>Madrid</p>
        <p className='currentTemp'>Madrid</p>
    </div>
  )
}
